  input: TEXT,F3XA,,"This amendment is filed in response to the Commission's letter
    dated March 23, 2005.  Electronic Schedule H1 has now been completed.  Schedule
    H2 has been deleted.  There were no impremissible overpayments by the Levin account.  Our
    federal account actually paid more than the required 28%. The payments disclosed
    on Line 30(b) do not refer to a clearly identified federal candidate or promote,
    support, attack or oppose any candidate for federal office.They do not constitute
    an in-kind contribution, an independent expenditure or a coordinated party expenditure.  No
    salary or wages were reported  as the Committee has no employees.  All functions
    are performed by consultants and volunteers.  Consultant payments have been reported.  The
    Line 2 calculations have been corrected.  The typo in the date entered for a contribution
    which took place in another reporting period has been corrected. The H6 now only
    lists memo entries.  Please see Form 99 immediately filed to continue the Committee's
    answer to the Commission's March 23, 2005 letter."
